        for i in range(len(strings) - 1):
            if strings[i].startswith(substring):
                new_list.append(strings[i])
            else:
                new_list.append(strings[i + 1])
        return new_list

    return filter(lambda s: s.startswith(substring), filter_by_substring_and_filter(strings))

